/*
 * alive 값이 1이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 0이 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
int alive = 1;

/*
 * mutex: 공유변수 reader_act, reader_wait, writer_act를 접근하기 위한 상호배타용 락
 * rcond: reader가 임계구역에 들어갈 수 없을 때 기다리는 조건변수 (또는 대기열의 이름)
 * wcond: writer가 임계구역에 들어갈 수 없을 때 기다리는 조건변수 (또는 대기열의 이름)
 * read_act: 현재 임계구역에서 실행 중인 reader의 수
 * read_wait: 임계구역에 들어가기 위해 대기중인 reader의 수
 * writer_act: 현재 임계구역에서 실행 중인 writer의 수 (1을 넘지 않는다)
 */
pthread_mutex_t mutex;
pthread_cond_t rcond;
pthread_cond_t wcond;
int reader_act = 0;
int reader_wait = 0;
int writer_act = 0;

/*
 * Reader 스레드는 같은 문자를 N번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * 공유 변수를 조회하고 변경하기 위해 mutex 락을 건다.
         */
        pthread_mutex_lock(&mutex);
        /*
         * reader가 임계구역에 들어갈 수 있는 조건이 만족되는지 검사하고
         * 만족하지 않으면 rcond 대기열에서 기다린다. 만족하면 진행한다.
         */
        while (writer_act == 1) {
            ++reader_wait;
            pthread_cond_wait(&rcond, &mutex);
            --reader_wait;
        }
        ++reader_act;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("<");
        for (i = 0; i < N; ++i)
            printf("%c", 'A'+id);
        printf(">");
        /* 
         * End Critical Section
         */
        /*
         * 공유 변수를 조회하고 변경하기 위해 mutex 락을 건다.
         */
        pthread_mutex_lock(&mutex);
        --reader_act;
        /*
         * reader_act가 0이면 더 이상 reader가 없으므로 writer가 들어갈 수 있도록
         * wcond 대기열에서 기다리고 있는 writer를 깨운다.
         * 그리고 나서 공유 변수에 대한 조회가 끝났으므로 mutex 락을 푼다.
         */
        if (reader_act == 0)
            pthread_cond_signal(&wcond);
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(0);
}

/*
 * Writer 스레드는 어떤 사람의 얼굴 이미지를 출력한다.
 * 이미지는 세 가지 종류가 있으며 인자를 통해 식별한다.
 * Writer가 critical section에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req;

    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 이미지 출력을 천천히 하기 위해 한 줄 출력할 때마다 쉬는 시간을 1 나노초로 설정한다.
     */
    req.tv_sec = 0;
    req.tv_nsec = 1L;
    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * 공유 변수를 조회하고 변경하기 위해 mutex 락을 건다.
         */
       pthread_mutex_lock(&mutex);
        /*
         * writer가 임계구역에 들어갈 수 있는 조건이 만족되는지 검사하고
         * 만족하지 않으면 wcond 대기열에서 기다린다. 만족하면 진행한다.
         */
        while (reader_act > 0 || writer_act == 1)
            pthread_cond_wait(&wcond, &mutex);
        ++writer_act;
        pthread_mutex_unlock(&mutex);
        /*
         * Begin Critical Section
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i) {
                    printf("%s\n", t[i]);
                    nanosleep(&req, NULL);
                }
                break;
            case 1:
                for (i = 0; i < L2; ++i) {
                    printf("%s\n", d[i]);
                    nanosleep(&req, NULL);
                }
                break;
            case 2:
                for (i = 0; i < L3; ++i) {
                    printf("%s\n", e[i]);
                    nanosleep(&req, NULL);
                }
                break;
            default:
                ;
        }
        /* 
         * End Critical Section
         */
        /*
         * 공유 변수를 조회하고 변경하기 위해 mutex 락을 건다.
         */
        pthread_mutex_lock(&mutex);
        --writer_act;
        /*
         * reader 선호 알고리즘이기 때문에 기다리는 reader가 있으면 *모두* 깨운다.
         * 기다리는 reader가 없으면 기다리는 writer를 깨운다.
         */
        if (reader_wait > 0)
            pthread_cond_broadcast(&rcond);
        else
            pthread_cond_signal(&wcond);
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(0);
}

int main(void)
{
    int i;
    int rarg[RNUM], warg[WNUM];
    pthread_t rthid[RNUM];
    pthread_t wthid[WNUM];
    struct timespec req, rem;

    /*
     * Initialize mutex lock and condition variables
     */
    pthread_mutex_init(&mutex, NULL);
    pthread_cond_init(&rcond, NULL);
    pthread_cond_init(&wcond, NULL);
    /*
     * Create RNUM reader threads
     */
    for (i = 0; i < RNUM; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, NULL, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /* 
     * Create WNUM writer threads
     */
    for (i = 0; i < WNUM; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, NULL, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-1);
        }
    }
    /* 
     * Wait for 0.2 second while the threads are working
     */
    req.tv_sec = 0;
    req.tv_nsec = 200000000L;
    nanosleep(&req, &rem);
    /*
     * Now terminate all threads and leave
     */
    alive = 0;
    for (i = 0; i < RNUM; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < WNUM; ++i)
        pthread_join(wthid[i], NULL);
    exit(0);
}
